INSERT INTO `blog_blog` VALUES (1,'Version 0.6.3','Announcing our first public release<br />\r\n\r\nThis is Version 0.6.3 of the FFG Star Wars Index<br />\r\n\r\nImplemented features:\r\n<ul>\r\n<li>Items\r\n<li>Weapons\r\n<li>Armor\r\n<li>Attachments\r\n<li>Vehicles\r\n<li>Starships\r\n</ul>\r\n\r\n','2014-06-03 09:07:22','2014-06-03 05:07:24','2014-06-03 09:07:22'),(2,'Version 0.6.4','Redundant views of Sections have been collapsed and given options.  Each section can be grouped by categories (default) or flatted out.  Each section can also be sorted by all columns (except for Weapon Specials).  Enjoy the new features.','2014-06-04 01:34:46','2014-06-03 21:34:49','2014-06-04 01:34:46'),(3,'Welcome to v1.0','OK folks this is the One.  We\'ve got a good base and major things reworked on this.  You\'ll notice we\'re split out on the left into \"Equipment\", \"Transportation\", and \"Books\".  Each section will open up into more detail when you are inside that section.<br />\r\nGoing to go though everything now and make sure that all the data we can enter is correct.  Hope you enjoy the site.','2014-06-07 15:08:55','2014-06-07 11:09:00','2014-06-07 15:08:55'),(4,'Version 1.0.2','There was a few minor tweaks between this and v1.0, but this one you should notice.  We\'ve updated some of the look.  Current color scheme is supposed to represent the color scheme from EotE tables.<br />\r\nWe\'ve also made the Main pages for Equipment and Transportation give you a list of all the sections and Categories in each section.<br />\r\nAs always, enjoy.','2014-06-09 10:47:30','2014-06-09 06:47:35','2014-06-09 10:47:30'),(5,'Version 1.1.0.0 Character/Adversaries','OK Folks we\'ve added in the features of some base Character pieces and the Adversaries section.  There\'s still a lot of data entry to deal with, but here\'s a peek at what the Adversaries will look like:<br />\r\n\r\n<img src=\"/static/adversary-peek.png\" /><br />\r\n\r\nAs always, I hope you enjoy.','2014-06-12 21:06:36','2014-06-12 17:06:42','2014-06-12 21:08:11'),(6,'Core Book Adversaries','The Adversaries chapter of the EotE CRB have been entered.<br />\r\nDroids and Creatures are a little funky.  They need to be split out on their own and special models created for their \"weapons\", but you can look up the specifics in the book anyway, that\'s what the index reference is there for.<br />\r\nEnjoy as always.\r\n','2014-06-15 18:35:45','2014-06-15 14:35:53','2014-06-15 18:35:45'),(7,'RSS Feeds now available','<p>I\'m a person who believes that if I can\'t get updates from RSS then the site doesn\'t exist.  So I\'m not sure why it took so long for me to add RSS to the site, but now it\'s available.</p>\r\n\r\n<p>For these blog entries you can go here: <a href=\"http://swrpg.viluppo.net/blog/feed/\">http://swrpg.viluppo.net/blog/feed/</a></p>\r\n\r\n<p>For Index Entries as they are added to the database go here: <a href=\"http://swrpg.viluppo.net/entries/feed/\">http://swrpg.viluppo.net/entries/feed/</a></p>\r\n\r\n<p>And as always, enjoy</p>','2014-06-16 02:31:42','2014-06-15 22:31:47','2014-06-16 02:32:07'),(8,'Weapon Reorg (v1.1.3.0)','<p>We\'ve finished off the code for Adversary Weapon Reorg.  What this means is that weapons have been separated into a few places.</p><p>The Weapons list (and other Equipment) that we had previously has been split into user purchasable items, and items that only appear on Adversaries.  We\'ve also split off Creature Weapons since those won\'t show up on anything but the creature specified.</p><p>Right now the coding is just in place.  We need to reorganize the data, but that\'s coming soon.</p>','2014-06-26 22:03:09','2014-06-26 18:03:18','2014-06-26 22:03:09'),(9,'Adversaries are complete (for now)','So, just in time for me to get my AoR CRB, the Adversaries for EotE are now complete.  Look around, let us know of any mistakes.  It\'s a lot of data entry so I know there\'s going to be a few.<br />\r\nI\'m going to take a bit to ingest AoR before I start entering anything.  Make sure nothing needs to change in the way the database is laid out.<br />\r\nAnd as always, enjoy.','2014-07-03 14:36:28','2014-07-03 10:36:37','2014-07-03 14:36:28'),(10,'AoR CRB Complete','The Age of Rebellion Core Rule Book should now be complete for items we already track.  Let me know if your favorite item or Adversary is missing.<br />\r\nAnd as always, enjoy.','2014-07-08 20:04:33','2014-07-08 16:04:46','2014-07-08 20:04:44'),(11,'Version 1.1.4.0 Weapon Qualities','<p>Previously the Special field on Weapons has simply been a text entry.  I\'ve created an entry now for the Weapon Qualities found on pages 154-157 in E-CRB and 168-170 of A-CRB.  The best feature of this is the ability to have this:</p>\r\n<p><a href=\"http://swrpg.viluppo.net/equipment/weaponqualities/1407/\">http://swrpg.viluppo.net/equipment/weaponqualities/1407/</a></p>\r\n<p>Once I have all the text fields converted over to links to the correct entry you\'ll be able to pull up a list of all weapons with a specific quality</p>\r\n<p>I hope you enjoy</p>','2014-07-11 00:40:24','2014-07-10 20:40:37','2014-07-11 00:40:58'),(12,'More stats coming','I\'ve got both Far Horizons and Onslaught on Arda I on it\'s way from CSI.<br />\r\nSo look out for new stuff!','2014-08-14 17:01:43','2014-08-14 13:02:06','2014-08-14 17:01:43'),(13,'New books entered','Far Horizons, Onslaught on Arda I, and Rescue at Glare Peak are now in the index.  \r\n\r\nEnjoy','2014-09-17 19:15:45','2014-09-17 15:16:21','2014-09-17 19:15:45'),(14,'We have Species','<p>Sorry I\'ve been a bit slack on this.  I\'ve had the details in the background of the system for a while I just didn\'t have the data in for player races so didn\'t produce a list previously.</p>\r\n\r\n<a href=\"http://swrpg.viluppo.net/character/species/\">Species</a>\r\n\r\n<p>There\'s still no detail view worth talking about but it does provide the index information that you were looking for.  The other species in the list are some background data I use for Creatures elsewhere in the index.</p>','2014-11-13 21:05:31','2014-11-13 16:06:22','2014-11-13 21:06:17'),(15,'Updates and support','Things have been pretty quiet here, but I will be changing that soon.  I\'ve just ordered all the books I could that are missing from the index.  Starting next week I\'ll be entering them as quickly as possible.\r\n\r\nAlso, if you\'re getting value from the site and can afford to do so, please help me with the server costs for this and other gaming aids that I provide.  You can support me at https://www.patreon.com/viluppo or through PayPal at servers@viluppo.net','2015-12-10 23:10:04','2015-12-10 18:09:33','2015-12-10 23:10:04'),(16,'Latest Purchases','Special thanks to James H. and Jason B., your PalPal donations helped purchase the EotE Beginner Game and Keeping the Peace (coming soon to the index).  To other Papal Donators, look for you name here as I purchase future books.\r\n\r\n<img src=\"http://swrpg-images.viluppo.net/blogs/IMG_20151224_091557.jpg\" width=700 />','2015-12-24 14:30:17','2015-12-24 09:29:29','2015-12-24 14:32:57'),(17,'It is time...','Updates are moving right along.  Strongholds of Resistance and Mask of the Pirate Queen are complete.  And while I do have Lead by Example in my hands (Thanks to William Stapleton for donations toward this purchase) I think it\'s time to move on.  It\'s time to start putting in Force and Destiny.\r\n\r\nCore, Chronicles of the Gatekeeper and Keeping the Peace are now on my desk, ready to be entered.  May the Force be with me :)','2016-02-09 19:23:57','2016-02-09 15:00:00','2016-02-09 19:23:57'),(18,'Data Entry and Updates','Well after a long time of being behind we are now up to date.  The only book not entered into the index is Savage Spirits, which of course is not out.  Please take a look and tell us of anything that looks wrong, we want to fix any issues as soon as possible.\r\n\r\nYou may have also notice that Vehicles and Starships are now quite pretty.  We have the stat block just like it shows in the books and have enhanced the image to make things look better.  We do need to get more images of vehicles that have transparent backgrounds, but we\'re working on it.\r\n\r\nHope you all enjoy.','2016-04-05 21:17:05','2016-04-05 17:17:01','2016-04-05 21:17:05');
