ey still may not train Streetwise above rank 2 during character creation.',''),(849,'[SPECIES] starts with one rank in Convincing Demeanor',''),(851,'A character my opt to carry a Ranged [Light] weapon or a one-handed melee weapon in each hand.',''),(865,'Once per encounter, [SELF] may reroll a skill check.',''),(873,'May spend a maneuver to add +1 ranged defense to up to two allied characters or minion groups within short range until the end of the next round.  This does not stack with multiple uses.',''),(878,'Silhouette 0',''),(879,'Remove all [SETBACK] from all checks',''),(882,'+1 soak',''),(896,'Xexto have six limbs, two legs and four armsl as a result, gain an additional free maneuver per turn, though still may not perform more than two maneuvers per turn.',''),(900,'[SPECIES] can exist in an atmosphere without ever needing to land on solid ground.',''),(906,'Remove up to [SETBACK] from any checks due to hot or arid environmental conditions.',''),(912,'When a non-humanoid alien species is targeting [SELF] with a social skill check, add [SETBACK].',''),(930,'Move objects at range.',''),(931,'Inflict strain on target',''),(935,'May spend a maneuver giving orders to other Wing Guar allies in  medium range, granting them [BOOST] on their next checks.',''),(939,'When purchasing legal or illegal goods, may reduce rarity by 1 without any accompanying price increase.',''),(950,'Anyone who suffers damage from the [SPECIES] must immediately make an Average Resilience check, suffering 5 strain if he fails.  Any [THREAT] generated on the Resilience check adds [SETBACK] to all the target\'s actions for a number of rounds equal to the [THREAT] generated.',''),(951,'Thanks to their finely hones senses of sight and hearing [SPECIES] gain [BOOST] to all Perception checks.',''),(952,'Opponets suffer [SETBACK][SETBACK] on any Perception or Vigilance checks made to detect a [SPECIES] while it is hunting.',''),(956,'[SPECIES] suffer no penalties when moving through difficult terrain.',''),(957,'Once per encounter, a [SPECIES] can use its free maneuver to move from medium range to engaged to attack a target.  Along with allowing the [SPECIES] to close quickly with its prey, a charge also adds 2 damage to the attack.',''),(962,'[SPECIES] add [BOOST] to all Resilience checks.',''),(963,'Murra have an encumbrance threshold of 25, and the difficulty of all Athletics checks made to lift excessive encumbrance is reduced by one.',''),(967,'[SPECIES] are incredibly territorial, and gain [BOOST] to all brawl checks made when attacking any intruders into what they consider their territory.',''),(968,'[SPECIES] add [BOOST][BOOST] to all Athletics checks made to perform vertical or horizontal jumps.',''),(972,'Anyone hearing the howl of a [SPECIES] must make a HARD Discipline check or become disoriented for one round plus one additional round for every [THREAT] generated.',''),(982,'[SPECIES] decrease the difficulty of any Perception or Vigilance checks they make by one.',''),(993,'Using their powerful maws and their quick-acting acidic saliva, [SPECIES] can move through solid stone as if it were difficult terrain.',''),(1001,'[SPECIES] suffer no penealties for moving through water and can breate underwater, but cannot move or survive on land.',''),(1005,'When incapacitated, [SPECIES] make one out-of-turn Brawl attack against one opponent with whom they are engaged.  This check gains [BOOST]',''),(1010,'Silhouette 2',''),(1014,'Any Perception checks made to detect a [SPECIES] suffer [SETBACK][SETBACK]; this affects scanners and macrobinoculars using thermal sensors or passive light amplification as well).',''),(1015,'[SPECIES] suffer no penalties when moving through rough terrain in dense jungle, dense forrecs, or swampy environments.',''),(1020,'[SPECIES] suffer no movement penalties in aquatic environments.',''),(1025,'Opponents affected by the Ensnare quality immediately begin suffering the effects of suffocation as outlined on page 214 of E-CRB.',''