uality until the end of the [SPECIES]\'s turn; this is a chemical burn.',''),(1930,'While within short range of a Huttlet,  non-Hutt characters reduce their strain thresholds by 2.',''),(1934,'Due to their cybernetic modifications, Ganks can communicate silently with other Ganks',''),(1936,'Gain a [BOOST] on all Survival checks made to trak prey, and adds [SETBACK] to enemy Stealth checks made against the [SPECIES]',''),(1942,'Does not need to breathe and can survive in vacuum and underwater;  immune to poisons and toxins.',''),(1943,'Once per encounter as an action, [SPECIES] can unleash a pulse of light from its body;  all targets within short range are disoriented for two turns.',''),(1948,'The GM may flip aone dark side Destiny Point to have the Kintan Strider heal 5 wounds.',''),(1949,'As an incidental, once per round, the GM may have the Kintan Strider reroll a Brawl or Melee check;  if he does so, the Kintan Strider loses the benefits of the Adversary and Durable talents until the beginning of its next turn.',''),(1953,'When making skill checks, Red Niktos mar remove [SETBACK] imposed due to arid or hot environmental conditions.',''),(1956,'Once per game session as an incidental, the elder may have a character within short range heal 4 wounds.',''),(1960,'When a rass is hit by a melee attack, the GM can spend [THREAT][THREAT] to inflict 1 wound [ignoring soak] on the attacker.',''),(1970,'May add [ADVANTAGE] to all Brawn-related skill checks.',''),(1974,'When engaged with a target, allies recieve [BOOST] to combat checks made against the engaged target.',''),(1979,'Weequay may communicate with other Weequay using pheromones if they are within short range of each other.',''),(1995,'Upgrade the difficulty of the social checks targeting the Vordan Enforcer\'s loyalty or interfere with his duty to his Hutt masters',''),(1998,'As an action, may make an Opposed Charm vs. Discipline check against a target at up to medium range to disorient the target for a number of