INSERT INTO `equipment_weaponquality` VALUES (1384,0,1,2,'For each rank of this trait, the attacker adds [BOOST] to his attack dice pools while using this weapon.',0,0),(1385,1,0,2,'Increase the difficulty of the attack by [DIFFICULTY].  If the attack hits the attacker can trigger Auto-fire. Auto-fire can be triggered multiple times.Each time the attacker triggers Auto-fire it deals an additional hit to the target.',0,0),(1386,0,1,2,'Ignore one point of Armor for every rank of Breach\r\n',0,0),(1387,1,1,2,'If the attack is successful, the target continues to take the weapon\'s base damage for a number of rounds equal to the weapon\'s Burn rating.',0,0),(1388,1,1,2,'If the attack is successful and Blast activates, each character (friend or foe) Engaged with the original target sufferes wounds equal to  the weapon\'s Blast rating.',0,0),(1389,1,1,2,'The target is staggered for a number of rounds equal to the weapon\'s Concussive rating.',0,0),(1390,0,0,2,'Weapons with the Cortosis quality are immune to the Sunder quality.',0,0),(1391,0,1,2,'The character needs a Brawn characteristic equal to or greater than the weapon\'s Cumbersome rating.',0,0),(1392,0,1,2,'A character wielding a weapon with the Defensive quality increases his melee defense by the weapons\'s Defensive rating.',0,0),(1393,0,1,2,'An item with the Deflection quality increases the wearer\'s ranged defense equal to its Deflection rating.',0,0),(1394,1,1,2,'The target is disoriented for a number of rounds equal to the weapon\'s Disorient rating.',0,0),(1395,1,1,2,'The target is immobilized for a number of rounds equal to the weapon\'s Ensnare rating.',0,0),(1396,1,1,2,'Weapon can make an attack check at the end of the round, the check\'s Ability dice are equal to the weapon\'s Guided rating.',0,0),(1397,1,0,1,'The target is knocked prone.',0,1),(1398,0,1,2,'Add [SETBACK] to the attacker\'s dice pool equal to their Inaccurate rating.',0,0),(1399,0,0,2,'Generates automatic [THREAT] on all checks.',0,0),(1400,0,0,2,'Damage is dealt as System Strain (Vehicles) or Strain Threshold (Droids)',0,0),(1401,0,1,2,'May be used to make a number of attacks equal to it\'s Limited Ammo rating before it must be reloaded.',0,0),(1402,1,1,2,'On a successful attack the wielder may activate to gain an additional hit and may do so a number of times equal to the weapon\'s Linked rating.',0,0),(1403,0,1,2,'Ignores one point of Soak for each rank of Pierce',0,0),(1404,0,1,2,'The user must perform a number of Prepare maneuvers equal to the weapon\'s Prepare rating before making attacks.',0,0),(1405,0,1,2,'Weapon must waith a number of rounds equal to its Slow-Firing rating before firing again.',0,0),(1406,1,1,2,'Weapon causes Strain to the target',0,0),(1407,0,0,2,'Weapon deals damage as strain instead of wounds.',0,0),(1408,1,0,1,'Damages opposing weapon one step.',0,0),(1409,0,0,2,'Generates automatic [ADVANTAGE] on all checks',0,0),(1410,0,0,2,'Target may not move unless it makes a successful Piloting check with a difficulty based on the tractor beam\'s rating.',0,0),(1411,0,1,2,'Add 10 times the Vicious rating to the critical roll.',0,0),(1412,0,0,2,'Can switch weapon to Stun Damage',0,0),(2518,0,1,2,'To wield correctly, character needs Agility characteristic equal or greater than rating.\r\n',0,0),(3377,0,0,2,'Must use Auto-fire; increase the difficulty of the attack by [DIFFICULTY]. If the attack hits the attacker can trigger Auto-fire. Auto-fire can be triggered multiple times.Each time the attacker triggers Auto-fire it deals an additional hit to the target.',0,0);
